import React from 'react'
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom'
import { AuthProvider, useAuth } from './contexts/AuthContext'
import LoginForm from './components/LoginForm'
import Dashboard from './components/Dashboard'
import Sidebar from './components/Sidebar'
import PatientsList from './components/PatientsList'
import AppointmentsPage from './components/AppointmentsPage'
import LabResultsPage from './components/LabResultsPage'
import PharmaciesPage from './components/PharmaciesPage'
import { Toaster } from 'react-hot-toast'

const Layout = ({ children }) => {
  return (
    <div className="flex h-screen bg-gray-100">
      <div className="w-64">
        <Sidebar />
      </div>
      <div className="flex-1 overflow-auto">
        {children}
      </div>
    </div>
  )
}

const ProtectedRoute = ({ children }) => {
  const { user, loading } = useAuth()

  if (loading) {
    return (
      <div className="flex items-center justify-center h-screen">
        <div className="animate-spin rounded-full h-32 w-32 border-b-2 border-primary-600"></div>
      </div>
    )
  }

  if (!user) {
    return <Navigate to="/login" replace />
  }

  return <Layout>{children}</Layout>
}

const AppRoutes = () => {
  return (
    <Routes>
      <Route path="/login" element={<LoginForm />} />
      <Route path="/" element={
        <ProtectedRoute>
          <Dashboard />
        </ProtectedRoute>
      } />
      <Route path="/patients" element={
        <ProtectedRoute>
          <PatientsList />
        </ProtectedRoute>
      } />
      <Route path="/appointments" element={
        <ProtectedRoute>
          <AppointmentsPage />
        </ProtectedRoute>
      } />
      <Route path="/lab-results" element={
        <ProtectedRoute>
          <LabResultsPage />
        </ProtectedRoute>
      } />
      <Route path="/pharmacies" element={
        <ProtectedRoute>
          <PharmaciesPage />
        </ProtectedRoute>
      } />
      <Route path="/doctors" element={
        <ProtectedRoute>
          <div className="p-6">
            <h1 className="text-3xl font-bold text-gray-900">Doctors</h1>
            <p className="text-gray-600">Doctors management coming soon...</p>
          </div>
        </ProtectedRoute>
      } />
      <Route path="/medications" element={
        <ProtectedRoute>
          <div className="p-6">
            <h1 className="text-3xl font-bold text-gray-900">Medications</h1>
            <p className="text-gray-600">Medications management coming soon...</p>
          </div>
        </ProtectedRoute>
      } />
      <Route path="/prescriptions" element={
        <ProtectedRoute>
          <div className="p-6">
            <h1 className="text-3xl font-bold text-gray-900">Prescriptions</h1>
            <p className="text-gray-600">Prescriptions management coming soon...</p>
          </div>
        </ProtectedRoute>
      } />
      <Route path="/vitals" element={
        <ProtectedRoute>
          <div className="p-6">
            <h1 className="text-3xl font-bold text-gray-900">Patient Vitals</h1>
            <p className="text-gray-600">Patient vitals management coming soon...</p>
          </div>
        </ProtectedRoute>
      } />
      <Route path="/immunizations" element={
        <ProtectedRoute>
          <div className="p-6">
            <h1 className="text-3xl font-bold text-gray-900">Immunizations</h1>
            <p className="text-gray-600">Immunizations management coming soon...</p>
          </div>
        </ProtectedRoute>
      } />
      <Route path="/settings" element={
        <ProtectedRoute>
          <div className="p-6">
            <h1 className="text-3xl font-bold text-gray-900">Settings</h1>
            <p className="text-gray-600">Settings coming soon...</p>
          </div>
        </ProtectedRoute>
      } />
    </Routes>
  )
}

function App() {
  return (
    <Router>
      <AuthProvider>
        <AppRoutes />
        <Toaster position="top-right" />
      </AuthProvider>
    </Router>
  )
}

export default App
